description:
Aliens in the Attic (2009) 
Alternatieve titel: Vreemde Gasten 

Verenigde Staten / Canada
Avontuur / Fantasy
86 minuten

geregisseerd door John Schultz
met Ashley Tisdale, Robert Hoffman en Kevin Nealon

De familie Pearson wil een weekend weg en besluit hun vakantiehuis weer eens op te zoeken. Ze ontdekken echter dat deze is overgenomen door aliens. De tienerdochter Bethany ontdekt al snel dat ze alles op alles moeten zetten om te voorkomen dat deze aliens de wereld zullen overnemen.

Vertaald door Simply ReleaseS Toppers
Tokke, Depositair en Suurtje

